import { Container, Typography } from "@material-ui/core";
import React, { Component } from "react";

class SignIn extends Component {
  render() {
    return (
      <div>
        <Container maxWidth="sm">
            <Typography component="h1" variant="h2"> </Typography>
        </Container>
      </div>
    );
  }
}

export default SignIn;
